import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Set a mobile viewport to ensure the mobile menu is active
    await page.setViewportSize({ width: 375, height: 667 });

    // Take initial screenshot in mobile view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_mobile_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_mobile_initial.png'));

    // Find and click the mobile menu trigger ("All")
    const menuTrigger = page.locator('.nav-menu', { hasText: 'All' });
    await menuTrigger.click();

    // Wait for the mobile menu overlay to become visible
    const mobileMenuOverlay = page.locator('#mobileMenuOverlay');
    await mobileMenuOverlay.waitFor({ state: 'visible' });

    // Take a screenshot of the open mobile menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_menu_open.png'));

    const isMenuVisible = await mobileMenuOverlay.isVisible();

    // Click on a navigation link within the mobile menu
    const electronicsLink = mobileMenuOverlay.getByRole('link', { name: 'Electronics', exact: true });
    await electronicsLink.click();

    // Wait for the content to update and verify the new heading is visible
    const categoryHeading = page.getByRole('heading', { name: 'Electronics' });
    await categoryHeading.waitFor({ state: 'visible' });

    // Take a screenshot to show the content has changed (menu might still be open)
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_navigated_to_electronics.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_navigated_to_electronics.png'));

    const navigatedCategory = await categoryHeading.textContent();

    // Find and click the close button within the mobile menu
    const closeButton = mobileMenuOverlay.getByRole('button', { name: 'Ã—' });
    await closeButton.click();

    // Wait for the mobile menu to be hidden
    await mobileMenuOverlay.waitFor({ state: 'hidden' });

    // Take a final screenshot to confirm the menu is closed
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_menu_closed.png'));

    const isMenuHidden = await mobileMenuOverlay.isHidden();

    return {
      success: true,
      action: "Successfully tested mobile menu: opened menu, navigated to a category, and closed the menu.",
      extractedData: {
        menuOpenedSuccessfully: isMenuVisible,
        navigatedCategory: navigatedCategory,
        menuClosedSuccessfully: isMenuHidden,
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, take a final screenshot for debugging
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));
    return {
      success: false,
      action: "Failed to test mobile menu navigation",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
